import string
from base64 import b64decode

def step3_decode(ciphertext, shift=4):
    loweralpha = string.ascii_lowercase
    shifted_string = loweralpha[-shift:] + loweralpha[:-shift]
    converted = str.maketrans(shifted_string, loweralpha)
    return ciphertext.translate(converted)

def step2_decode(s):
    return b64decode(s)

def step1_decode(s):
    _step1 = str.maketrans("mlkjihgfedcbaMLKJIHGFEDCBAzyxwvutsrqponZYXWVUTSRQPON",
                           "zyxwvutsrqponZYXWVUTSRQPONmlkjihgfedcbaMLKJIHGFEDCBA")
    return s.translate(_step1)

def decode_secret(encoded):
    s = encoded[1:]  # Remove the initial '2'
    s = step3_decode(s)
    s = step2_decode(s)
    # Handle step1 as bytes instead of converting to a UTF-8 string
    s = step1_decode(s.decode('latin-1'))  # Using 'latin-1' to avoid Unicode errors
    return s


if __name__ == '__main__':
    encoded_secret = ""
    print(decode_secret(encoded_secret))
